<table id="windowNavigator">

</table>
<!--#include virtual="/tpl/footer.html"-->
<script>
    var windowNavigator = document.getElementById('windowNavigator');
    var str = '';
    for (var propName in navigator) {
        str+=`<tr><td>${propName}</td><td>${navigator[propName]}</td></tr>`;
    }
    windowNavigator.innerHTML = str;
    console.log(navigator);
</script>
